function maximumSum(nums: number[]): number {
    const primeFactors = (x: number): Map<number, number> => {
        const factors = new Map<number, number>();
        for (let i = 2; i * i <= x; i++) {
            while (x % i === 0) {
                factors.set(i, (factors.get(i) || 0) + 1);
                x /= i;
            }
        }
        if (x > 1) factors.set(x, (factors.get(x) || 0) + 1);
        return factors;
    };

    const normalize = (factors: Map<number, number>): string => {
        let res = '';
        factors.forEach((count, factor) => {
            if (count % 2 !== 0) res += `#${factor}`;
        });
        return res;
    };

    const groups = new Map<string, number>();
    let maxSum = 0;

    for (const num of nums) {
        const factors = primeFactors(num);
        const key = normalize(factors);
        const sum = (groups.get(key) || 0) + num;
        groups.set(key, sum);
        maxSum = Math.max(maxSum, sum);
    }

    return maxSum;
};
